        "System B": "Many modern gas pumps have a credit or debit card option instead of a cash option. This is because most gas stations do not want to keep large amounts of cash on hand. If a customer wants to pay with cash, the cash must be brought to the pump by the customer, which requires management of cash on the part of the gas station, as well as the risk that the cash will be stolen or lost.",
